import React from 'react';

const KeyInfoCards = ({ data = [] }) => (
  <div className="key-info-cards">
    {data.map((item, index) => (
      <div key={index} className="key-info-card">
        <img src={item.icon} alt={item.label} />
        <div>
          <p>{item.value}</p>
          <p>{item.label}</p>
        </div>
      </div>
    ))}
  </div>
);

export default KeyInfoCards;
